# Zizik, Republic of Dagestan

}}
Zizik (; ) is a rural locality (a selo) in Karchagsky Selsoviet, Suleyman-Stalsky District, Republic of Dagestan, Russia. Population:  There are 15 streets.
Geography
Zizik is located on the Karchagsu River,  southeast of Makhachkala and  north of Kasumkent (the district's administrative centre) by road. Nyutyug is the nearest rural locality.
